原型链继承获取父类的属性和方法
1.fatherFn通过this声明的属性/方法都会绑定在new期间创建的新对象上。2.新对象的原型是father.prototype,通过原型链的属性查找到father.prototype的属性和方法。  
理解new做了什么：

new在本文出现多次，new也是JS基础中很重要的一块内容，很多知识点会涉及到new，不太理解的要多看几遍.

1.创建一个全新的对象。2.这个新对象的原型(proto)指向函数的prototype对象。3.执行函数，函数的this会绑定在新创建的对象上。4.如果函数没有返回其他对象(包括数组、函数、日期对象等)，那么会自动返回这个新对象。5.返回的那个对象为构造函数的实例。
2.组合继承

原理：使用原型链继承(new)将this和prototype声明的属性/方法继承至子类的prototype上，使用借用构造函数来继承父类通过this声明属性和方法至子类实例的属性上。   

